# OEIS sequence: A245085

from sympy import prime
def A245085(n):
    p, f, fv = prime(n), 1, {}
    for i in range(2,p):
        f = (f*i) % p
        if f in fv:
            return i-1
        else:
            fv[f] = i
    return p-1 # _Chai Wah Wu_, Dec 15 2014

